import './App.css';
import styled from "styled-components";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import 'font-awesome/css/font-awesome.min.css';

import Partner from './components/Home/Partner.jsx';
import Whoarewe from './components/Home/Whoarewe.jsx';
import Vision from './components/Home/Vision.jsx';
import Products from './components/Home/Products.jsx';

import HeroSection from './components/Homepage/HeroSection.jsx';
import TMT_Bars from './components/Our_Services/TMT_BARS/TMT_Bars.jsx';
import AboutUs from './components/About_us/About_us.jsx';
import ContactUs from './components/Contact_us/Contact_us.jsx';
import Navbar from './components/Navbar/Navbar.jsx';
import Footer from './Footer/Footer.jsx';

// New imports for TMTGradeComponent and images
import React from 'react';
// import TMTGradeComponent from './components/TMTGradeComponent';
import fe500Image from './components/fe500.png';
import fe500dImage from './components/fe500d.png';
import './styles/App.scss';

const StyledDiv = styled.div`font-family: 'Outfit', sans-serif; color: #333;`;

function App() {
  return (
    <Router>
      <StyledDiv>
        <Navbar/>
        <Routes>
          <Route path="/" element={<HeroSection />} />
          <Route path="/about-us" element={<AboutUs />} />
          <Route path="/products" element={<Products />} />
          <Route path="/products/tmt-bars" element={<TMT_Bars />} />
          <Route path="/contact-us" element={<ContactUs />} />
          {/* New route for TMT Grades */}
          <Route path="/tmt-grades" element={
            <div className="App">
              <h1>TMT Bar Grades</h1>
              <TMT_Bars
                grade="Fe500"
                description="Fe500 TMT bars are known for their high strength and durability, making them ideal for construction purposes."
                features={[
                  'High tensile strength',
                  'Excellent ductility',
                  'Earthquake resistance',
                  'Thermo-mechanical treatment',
                ]}
                image={fe500Image}
                strength="500 MPa"
                elongation="12%"
                corrosionResistance="High"
              />
              <TMTGradeComponent
                grade="Fe500D"
                description="Fe500D TMT bars are enhanced with higher ductility, making them suitable for seismic zones and high-stress applications."
                features={[
                  'Higher ductility than Fe500',
                  'Superior earthquake resistance',
                  'Better weldability',
                  'Enhanced corrosion resistance',
                ]}
                image={fe500dImage}
                strength="500 MPa"
                elongation="16%"
                corrosionResistance="Very High"
              />
            </div>
          } />
          <Route path="*" element={<div>Page Not Found</div>} />
        </Routes>
        <Footer/>
      </StyledDiv>
    </Router>
  );
}

export default App;
